6=relieve the siege. In case of incapacitation, a hospital ship near 
7=the coast will tend to your injuries, allowing a hasty return to the 
8=field. You will also find the hospital in the besieged base useful 
9=for this purpose.@@The objective is the destruction of the main 
10=Soviet base in the sector. Wipe out any Soviet forces in your way! 

